    @Override
    public void keyAction(char keyChar) {
        switch(keyChar){
            case 's':
                start = true;
                break;
            case 'q':
                start = false;
                try {
                    fileWriter.close();
                }
                catch(Exception ex) {
                }
                System.exit(0);
                break;
            default:
                throw new IllegalStateException("Unexpected value: " + keyChar);
        }
    }

    @Override
    public void setup() {

        this.start = false;
        this.dim = 4;
        this.scale = 100;
        this.g = 5.;
        this.t = 0;
        this.dt = 0.001;
        this.pivotX = 300;
        this.pivotY = 400;
        this.duration  =10;

        //setup initial conditions
        //this.r  = new double[]{1./3,1./6,1./11,1./18,0.5};//big circles
        //this.r  = new double[]{1./6,1./14,1./30,1./54,0.5}; //outer circles
        this.r  = new double[]{1./15,1./23,1./39,1./63,0.5}; //inner circles
        this.m = new double[dim];
        for (int i = 0; i < dim; i++) {
            m[i]=r[i]*r[i];
        }

        System.out.print("masses: ");
        for (int i = 0; i < dim; i++) {
            System.out.print("m[" + i + "]=" + m[i]+"\t");
        }
        System.out.println();

        //this.l = new double[]{1.65,0.99,0.51,0.29,0.75}; //big circles
        //this.l = new double[]{1.32,1.738542669,0.7765846735,0.3946396387,0.75}; //outer circles
        this.l = new double[]{1.122,0.8540319762,0.53006011,0.3201448772,0.75}; //inner circles
        System.out.print("length: ");
        for (int i = 0; i < dim; i++) {
            System.out.print("l[" + i + "]=" + l[i]+"\t");
        }
        System.out.println();

        mu = new double[dim*10+dim+1];

        System.out.print("Mass sums: ");
        for (int i = 0; i < dim-1; i++) {
            int I=i+1;
            for (int j = i; j <dim ; j++) {
                mu[I*10+dim]+=m[j];
            }
            System.out.print("mu[" + (I*10 + dim) + "]=" + mu[I*10 + dim]+"\t");
        }
        System.out.println();

        double pi = Math.PI;
        //this.phi = new double[]{pi/2,0.2186689453,-0.5070985044,-0.8379812250}; //outer circles left
        //this.phi = new double[]{-pi/2,-0.2186689453,0.5070985044,0.8379812250}; //outer circles right
        //this.phi = new double[]{0.4899573264,0.6327488348,-0.03332099225,-0.4366271596}; //inner circles left
        this.phi = new double[]{-0.4899573264,-0.6327488348,0.03332099225,0.4366271596}; //inner circles right
        //this.phi = new double[]{0.9272952,0.,-0.489957,-0.76101275}; //big circles left
        //this.phi = new double[]{-0.9272952,0.,0.489957,0.76101275}; //big circles right
        //this.phi = new double[]{-pi/2,pi/2,-pi/2,pi/2,-pi/2};
        //this.phi = new double[]{-pi/5,pi/5,-pi/5,pi/5,-pi/5};
        System.out.print("initial angles: ");
        for (int i = 0; i < dim; i++) {
            System.out.print("phi[" + i + "]=" + phi[i]+"\t");
        }
        System.out.println();

       this.o = new double[]{0.,0.,0.,0.,0.};
        System.out.print("initial angular velocities: ");
        for (int i = 0; i < dim; i++) {
            System.out.print("omega[" + i + "]=" + o[i]+"\t");
        }
        System.out.println();

        URL url = null;
        url = currentThread().getContextClassLoader().getResource("");

        fileWriter = null;
        try {
            fileWriter = new FileWriter(url.getPath()+"/"+"pendulumInnerRight.csv");
        } catch (IOException e) {
            e.printStackTrace();
        }
        printWriter = new PrintWriter(fileWriter);

    }

    @Override
    public void draw() {
        canvas.clear(new Color(0,0,0));
        canvas.setPenColor(Color.WHITE);
        canvas.text(40,20,String.format("%.2f s",t));


      //  System.out.println(String.format("%.2f %.2f %.2f %.2f %.2f",t,phi[0],phi[1],phi[2],phi[3]));

        if (start) {
            phi = framestep();

            if (printWriter!=null)
                printWriter.printf(t+", ");
            for (int i = 0; i < phi.length; i++)
                printWriter.print(phi[i]+",");
            printWriter.println();
        }

        canvas.filledCircle(pivotX,pivotY,0.5*scale);
        double x=pivotX;
        double y=pivotY;
        double x0 = x;
        double y0 = y;
        for (int i = 0; i <dim; i++) {
            x-=scale*l[i]*Math.sin(phi[i])/2;
            y-=scale*l[i]*Math.cos(phi[i])/2;
            canvas.line(x0,y0,x,y);
            canvas.filledCircle(x,y,scale*r[i]);
            x0 = x;
            y0 = y;
        }

    }




